　ミスト式ではなく、ファン式を採用。<BR>
水を使わず雑菌の飛散を防ぎます。<BR><BR>

水に溶かさないため、オイルの自然な香りをダイレクトに楽しめます。<BR><BR>

オイルを垂らしてスイッチを押すだけ、すぐにアロマを楽しめます。<BR><BR>

弱モードと強モードの切替式。使用シーンに合わせ、お選びいただけます。<BR><BR><table cellpadding="3" cellspacing="1" bgcolor="#000000">
<tr>
<td bgcolor="#ffffff">電源</td><td bgcolor="#ffffff">AC100V　50・60Hz</td></tr> 
<tr>
<td bgcolor="#ffffff">重量</td><td bgcolor="#ffffff">約600g</td></tr> 
<tr>
<td bgcolor="#ffffff">消費電力</td><td bgcolor="#ffffff">8W</td></tr> 
<tr>
<td bgcolor="#ffffff">運転モード</td><td bgcolor="#ffffff">強/弱　切り替え式</td></tr> 
<tr>
<td bgcolor="#ffffff">芳香範囲（目安）</td><td bgcolor="#ffffff">6～8畳</td></tr> 
<tr>
<td bgcolor="#ffffff">外形寸法</td><td bgcolor="#ffffff">W130×D130×H165mm</td></tr> 
<tr>
<td bgcolor="#ffffff">電源コード長さ</td><td bgcolor="#ffffff">1.5m</td></tr> 
<tr>
<td bgcolor="#ffffff">ケース材質</td><td bgcolor="#ffffff">ABS樹脂、ポリプロピレン</td></tr> 
<tr>
<td bgcolor="#ffffff">価格</td><td bgcolor="#ffffff">オープン価格</td></tr> 
<tr>
<td bgcolor="#ffffff">付属品</td><td bgcolor="#ffffff">アロマフィルタ1枚、静電フィルタ1枚</td></tr>
